import React, { Component } from 'react';

class todoListDetail extends Component {
  constructor(props) {
    super(props);
    this.state = {
      params: {
        id: '',
        title: ''
      }
    }
  }
  render() { 
    return (
      <div>
        <h2>{this.state.params.id}</h2>
        <p>{this.state.params.title}</p>
      </div>
    );
  }

  componentDidMount() {
    console.log(this.props)
    let params = this.props.location.params
    this.setState({
      params: params
    })
  }
}

export default todoListDetail;
